v:cp.v:val:
VT4(If Yes - the asset is new (that is, the current date is within 90 days of asset delivery) and acceptable verification evidence is provided, proceed to 05.
If No - the asset is not new, proceed to 06.
)

VT4(If Yes - the asset information listed in e-AMT is accurate and acceptable verification evidence has been provided (as detailed in step 08, above) proceed to 12.
If No - the asset information listed in e-AMT is not accurate, proceed to 10.
)

VT4(Obtain verification evidence & record the asset information as 'Correct'; OR Record the asset information as 'Incorrect'.
A test is conducted to determine whether the asset information stored in e-AMT matches the physical situation of the located asset; verification evidence is obtained; and the result is retained.
)

VT4(Obtain verification evidence & record the asset information as 'Correct'; OR Record the asset information as 'Incorrect'.
A test is conducted to determine whether the asset information stored in e-AMT matches the physical situation of the located asset; verification evidence is obtained; and the result is retained.
)

VT4(If Yes - the reverse test results included 'Unlocated' assets or 'Incorrect' asset information, proceed to 14.
If No - the reverse test results found all assets to be 'Located' with 'Correct' asset information in e-AMT, proceed to 15.
)

VT4(Locate the 'IT Fixed Assets - Reverse Test Sample' in the Business Process Testing Repository for the Location and record and/or calculate the following:
Record the total number of assets tested during the reverse test;
Record the total number of assets located in e-AMT during the reverse test (ie. assets from the office floor that have corresponding e-AMT records); and
Calculate the total number of assets selected, tested and located with correct asset information in e-AMT.
Proceed to 16.
)

VT4(Send a copy of  the updated 'IT Fixed Assets - Reverse Test Sample' for the location to ADL Business Operations with the final test results, copying the senior manager for the location. The procedure ends.
Ensure the completed report is sent to ADL Business Operations by the required date. 
)
